import React, { useEffect, useState } from "react";
import style from "./loginform/loginform.module.css"

function LoginSignup() {
    const [have_account, setAccount] = useState(false);
    return (

             <div className={style.outerDiv}>
            <div className={style.logindiv}></div>
             <h1 className={style.logintitle}>Log In</h1><br/>
            <Button className={style.loginnoaccount} onClick={() => setAccount(true)}>You don't have an account?</Button><br/><br/>
           <Loginimage/>
           <Loginform/>

        </div>
    )
}

export default LoginSignup;
